import "./Patient.css";

const Patient = (props) => {
   const patientData = props.patientData[0];
   const firstName = patientData.patient_name.split(" ")[0];
   return (
      <div className="patient-container">
         <h2>Hello, {firstName}</h2>
         <p>Your patient code is: <strong>{patientData.patient_code}</strong></p>
         <p>Your wait time is: {patientData.wait_time} minutes</p>
      </div>
   );
};

export default Patient;
